import React from "react"
import {AppBar, Typography} from "@mui/material";
import AppRegistrationIcon from '@mui/icons-material/AppRegistration';
const Header = () => {
  return (
    <div>
        <AppBar position="sticky">
           
        <Typography> 
                <AppRegistrationIcon/> 
        </Typography>
            
           
        </AppBar>
    </div>
  );
};

export default Header;
